INSERT INTO `courses` (`id`, `title`, `course_img`, `general_description`, `matters`, `for_whom`, `results`, `additional_info`, `language`, `main`) VALUES
(1, 'Wprowadzenie do analizy danych RNA-Seq', , 'Ten kurs stanowi wprowadzenie do tematyki związanej z analizą danych RNA-Seq. Pozwala on na zapoznanie się z najważniejszymi krokami analizy, powszechnie stosowanymi potokami analitycznymi i możliwymi zastosowaniami. W trakcie kursu poruszone zostaną zagadnienia kontroli jakości danych, składania transkryptomu ab initio oraz de novo, szacowania ekspresji genów i analizy różnicowej.', '1. Krótkie wprowadznie do wysokoprzepustowego sekwencjonowania genomów i transkryptomów.\r\n2. Kontrola jakości danych.\r\n3. Mapowanie odczytów, obliczanie poziomu ekspresji genów i tranksryptów.\r\n4. Analiza ekspresji różnicowej wraz z tworzeniem wykresów diagnostycznych.\r\n5. Składanie transkryptomu de novo (niezależne od genomu).\r\n6. Składanie transkryptomu ab initio (z mapowaniem odczytów do genomu).\r\n7. Adnotacja transkryptomów', 'Ten wprowadzający kurs skierowany jest do każdego, kto chce się dowiedzieć jak radzić sobie z zestawami wielkoskalowych danych RNA-Seq i poszerzać wiedzę o istotnych biologicznych aspektach tego zagadnienia. Kurs jest przygotowany pod kątem osób prowadzących badania w dziedzinach biotechnologii, biologii molekularnej, bioinformatyki i innych nauk biologicznych.', 'Po ukończeniu kursu uczestnicy powinni posiadać wiedzę o źródłach danych RNA-Seq, formatach danych, być w stanie wykonać analizę jakości tych danych, mapowanie do sekwencji referencyjnej, ocenę wartości ekspresji genów/transkryptów i wykonać analizę ekspresji różnicowej włącznie z interpretacją otrzymanych wyników. Uczestnicy posiądą również wiedzę o metodach składania transkryptomów i będą w stanie wykorzystać poznane potoki analityczne we własnych projektach. Duża uwaga zwrócona będzie na wizualizację danych, tworzenie wykresów, interpretację wyników i radzenie sobie z często spotykanymi problemami podczas analizy.', 'Kurs odbędzie się w terminie wskazanym po lewej stronie przycisku \"Zarejestruj się\" w formie webinarium. Wymagane jest posiadanie komputera z systemem Windows, Linux lub Mac OS posiadającego dostęp do internetu. Organizator zastrzega sobie prawo do odwołania kursu nie później niż na dwa tygodnie przed datą jego rozpoczęcia w przypadku mniej niż 5 uczestników.', 'polish', 0x5dd81c503d9492ff005c5f025f5c00489732e21964a4ffe0897ed51dba01594876514cc120660b9f742dead9c0dfeffa);
INSERT INTO `courses` (`id`, `title`, `course_img`, `general_description`, `matters`, `for_whom`, `results`, `additional_info`, `language`, `main`) VALUES
(2, 'Analiza interakcji DNA-białko', , 'Ten kurs stanowi wprowadzenie do tematyki związanej z analizą danych ChIP-seq oraz ChIPexo, czyli wysokoprzepustowymi metodami badania interakcji białek z DNA. Kurs pozwala na zapoznanie się z najważniejszymi krokami analizy, powszechnie stosowanymi potokami analitycznymi i możliwymi zastosowaniami.', '1. Wprowadzenie do systemu Linux.\r\n2. Bazy danych.\r\n3. Detekcja miejsc występowania wiązań Białko-DNA z wykorzystaniem ChIP-Seq.\r\n4. Wyszukiwanie motywów sekwencji w miejscach wiązania białek z DNA.\r\n5. Wizualizacja danych (IGV).\r\n6. Analiza stanu chromatyny: modyfikacje histonów.\r\n7. Zwiększenie dokładności detekcji miejsc występowania wiązań Białko-DNA przy pomocy techniki ChIP-exo.\r\n8. Projekt - efektywna praca z plikami w formatach powszechnie używanych w pracy z danymi ChIP-Seq.', 'Ten wprowadzający kurs skierowany jest do każdego, kto chce się dowiedzieć, jak analizować dane ChIP-Seq pod kątem konkretnych pytań biologicznych. Kurs jest dostosowany do osób prowadzących badania w dziedzinach biotechnologii, biologii molekularnej, bioinformatyki i innych nauk biologicznych.', 'Po ukończeniu kursu uczestnicy powinni posiadać wiedzę o podstawowych źródłach danych ChIP-Seq oraz ChIP-exo i formatach danych wykorzystywanych powszechnie w trakcie analiz. Uczestnicy powinni umieć samodzielnie wykonać analizę polegającą na wykrywaniu miejsc interakcji DNA i białek, w tym czynników transkrypcyjnych i histonów, a także potrafić wyszukiwać motywy charakterystyczne dla tychże stref wiązania. Zwrócimy szczególną uwagę na wizualizację danych w przeglądarce genomowej, interpretację wyników i radzenie sobie z problemami często spotykanymi podczas analizy tego rodzaju danych.', 'Kurs odbędzie się w terminie wskazanym po lewej stronie przycisku \"Zarejstruj się\" w formie webinarium. Wymagane jest posiadanie komputera z systemem Windows, Linux lub Mac OS posiadającego dostęp do internetu. Organizator zastrzega sobie prawo do odwołania kursu nie później niż na dwa tygodnie przed datą jego rozpoczęcia w przypadku mniej niż 5 uczestników.', 'polski', 0x6afdad0a78f49d6de0eefa70f7b5b32187b75aaea6ed8c0110731d27b15584aae795edc062766626bb708380537cf7f23f9394d97ad8298391d01a7737bc3154a9a418c52c494991182ae037e384ee59548caea83f9020d7fa885dd133542058);

